import React from 'react';
import './App.css';
import HomePage from './pages/HomePage.js';
import {
    BrowserRouter as Router,
    Route,
} from 'react-router-dom';

function App() {
  return (
      <Router>
          <div className="App">
            <div id="page-id">
              <Route path="/" component={HomePage} exact/>
            </div>  
          </div>
      </Router>
  );
}

export default App;
